import React, {Component} from 'react';

function Login() {
    return (
        <div>
            <form>
                <label class="mb-3" >
                    Username:
                    <input type="text" name="username" />
                </label>
                <label class="mb-3">
                    Password:
                    <input type="password" name="password" />
                </label>
                <input type="submit" value="Submit" />
            </form> 
        </div>
    )
}

export default Login;
